<!DOCTYPE html>
<html lang="sl">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Zaščitena stran - Reputacija+</title>
<style>
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}
body {
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
  background: linear-gradient(135deg, #B71C1C 0%, #C62828 50%, #D32F2F 100%);
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 20px;
}
.password-container {
  background: white;
  padding: 50px 40px;
  border-radius: 16px;
  box-shadow: 0 20px 60px rgba(0,0,0,0.4);
  max-width: 450px;
  width: 100%;
  text-align: center;
}
.logo {
  max-width: 280px;
  height: auto;
  margin-bottom: 30px;
}
.text-logo {
  margin-bottom: 30px;
  font-size: 36px;
  font-weight: 700;
  letter-spacing: 2px;
}
.logo-r {
  display: inline-block;
  background: #B71C1C;
  color: white;
  width: 60px;
  height: 60px;
  line-height: 60px;
  text-align: center;
  border-radius: 8px;
  margin-right: 8px;
  font-size: 42px;
}
.logo-plus {
  color: #B71C1C;
}
.password-container h1 {
  color: #333;
  margin-bottom: 10px;
  font-size: 24px;
  font-weight: 600;
}
.password-container .subtitle {
  color: #888;
  margin-bottom: 35px;
  font-size: 13px;
  text-transform: uppercase;
  letter-spacing: 1px;
}
.password-container p {
  color: #666;
  margin-bottom: 25px;
  font-size: 15px;
}
.password-input {
  width: 100%;
  padding: 16px;
  border: 2px solid #e0e0e0;
  border-radius: 8px;
  font-size: 16px;
  margin-bottom: 15px;
  transition: border-color 0.3s;
}
.password-input:focus {
  outline: none;
  border-color: #B71C1C;
}
.password-button {
  width: 100%;
  padding: 16px;
  background: #B71C1C;
  color: white;
  border: none;
  border-radius: 8px;
  font-size: 16px;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s;
  text-transform: uppercase;
  letter-spacing: 1px;
}
.password-button:hover {
  background: #C62828;
  transform: translateY(-2px);
  box-shadow: 0 10px 25px rgba(183, 28, 28, 0.3);
}
.password-button:active {
  transform: translateY(0);
}
.error-message {
  color: #c62828;
  font-size: 14px;
  margin-top: 15px;
  display: none;
  font-weight: 500;
}
.lock-icon {
  font-size: 40px;
  margin-bottom: 20px;
  opacity: 0.3;
}
#protected-content {
  display: none;
}
.powered-by {
  margin-top: 30px;
  padding-top: 20px;
  border-top: 1px solid #f0f0f0;
  color: #999;
  font-size: 12px;
}
.powered-by strong {
  color: #B71C1C;
}
</style>
</head>

function sha256(str) {
  const buffer = new TextEncoder().encode(str);
  return crypto.subtle.digest('SHA-256', buffer).then(hash => {
    return Array.from(new Uint8Array(hash))
      .map(b => b.toString(16).padStart(2, '0'))
      .join('');
  });
}

async function checkPassword() {
  const input = document.getElementById('passwordInput');
  const errorMsg = document.getElementById('errorMessage');
  const password = input.value;
  
  const hash = await sha256(password);
  
  if (hash === correctPasswordHash) {
    // Correct password - show content
    document.getElementById('passwordPrompt').style.display = 'none';
    
    // Decode and display protected content
    const decoded = atob(protectedHTML);
    const content = document.getElementById('protected-content');
    content.style.display = 'block';
    
    // Write the decoded HTML
    document.open();
    document.write(decoded);
    document.close();
  } else {
    // Wrong password
    errorMsg.style.display = 'block';
    input.value = '';
    input.focus();
    
    // Shake animation
    input.style.animation = 'shake 0.5s';
    setTimeout(() => {
      input.style.animation = '';
    }, 500);
  }
}

// Allow Enter key to submit
document.getElementById('passwordInput').addEventListener('keypress', function(e) {
  if (e.key === 'Enter') {
    checkPassword();
  }
});

// Focus on input when page loads
window.onload = function() {
  document.getElementById('passwordInput').focus();
};
</script>

<style>
@keyframes shake {
  0%, 100% { transform: translateX(0); }
  25% { transform: translateX(-10px); }
  75% { transform: translateX(10px); }
}
</style>
